  const myStyle = {backgroundImage: `url(${image})`, backgroundRepeat: 'no-repeat' , 
  backgroundSize : 'stretch' ,
  backgroundPosition: 'center' ,
  textAlign: 'center'  ,
  height: 362* ratio ,
  width: win.width 
};
